import styled from "styled-components";
import zap from "../assets/7c81bd56-d313-48fc-8857-426e4f05d713.jpg"
import Fachada from "../assets/7c81bd56-d313-48fc-8857-426e4f05d713.jpg"

export const Foto = styled.img`
    width: 100%;
    height: 600px;
    display: flex;
    align-self: center;
    background-image: url(${Fachada}); 

`;

export const Container = styled.div`
    width: 100%;
    height: auto;
`;

export const NomeText = styled.div`

`;

export const InfoContainer = styled.div`
    width: 100%;
    height: 700px;
    display: flex;
    background-color: red;
    align-items: center;
    justify-content: center;
`;

export const FotoTamiao = styled.div`
    width: 400px;
    height: 600px;
    color: #fff;
    background-image: url(${zap});
    border: 4px #090909 solid;
    margin-right: 300px;
    border-radius: 20%;
`;

export const TextoTamiao = styled.div`
    width: 600px;
    height: 300px;
    font-size: 18px;
    font-weight: bold;
    color: black;
`;
